import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import { NavBar } from './components/NavBar.js';
import { Home } from './components/Home.js';
import { Content } from './components/Content.js';
import { AboutUs } from './components/Aboutus.js';

function App() {
  return (
    <div className="App">
      <NavBar />
      <Home />
      <Content />
      <AboutUs />
    </div>
  );
}

export default App;
